        <ScrollReveal>
          <h2 className="mb-8 text-2xl font-semibold text-foreground sm:text-3xl">
            Experience
          </h2>
        </ScrollReveal>
        <div className="relative">
          {/* Timeline line */}
          <div className="absolute left-[7px] top-0 bottom-0 w-px bg-border" />
          {currentExperiences.map((exp, i) => (
