        className="py-24"
        gradientBottom="linear-gradient(to bottom, transparent, rgba(16, 185, 129, 0.025))"
      >
        <ScrollReveal>
          <h2 className="mb-8 text-2xl font-semibold text-foreground sm:text-3xl">
            Featured Work
          </h2>
