/* ── Hero letter animation ───────────────────── */

const nameLetters = "Cameron Keith".split("");

const containerVariants = {
  hidden: {},
  visible: {
    transition: { staggerChildren: 0.03 },
  },
};

const letterVariants = {
  hidden: { opacity: 0, y: 20 },
  visible: { opacity: 1, y: 0, transition: { duration: 0.4, ease: "easeOut" } },
};

/* ── Component ───────────────────────────────── */

export function HomePageClient() {
  const prefersReducedMotion = useReducedMotion();

  const currentExperiences = experiences.filter((e) => e.current).slice(0, 3);
  const highlighted = featuredProjects.slice(0, 2);
  const topAchievements = golfData.achievements.slice(0, 4);
  const golfTagline = golfData.athleticBio.split(".")[0] + ".";
  const storyExcerpt = aboutContent.sections[0].body.split(". ").slice(0, 2).join(". ") + ".";

  return (
    <>
      <ScrollProgressBar />

      {/* ── 1. Hero ── */}
      <ScrollSection
        id="hero"
        fullHeight
        parallax
        className="flex items-center"
        gradientBottom="linear-gradient(to bottom, transparent, rgba(16, 185, 129, 0.02))"
      >
        <div className="py-24">
          {prefersReducedMotion ? (
            <h1 className="text-5xl font-bold tracking-tight text-foreground sm:text-6xl">
              Cameron Keith
            </h1>
          ) : (
            <motion.h1
              className="text-5xl font-bold tracking-tight text-foreground sm:text-6xl"
              variants={containerVariants}
              initial="hidden"
              animate="visible"
            >
              {nameLetters.map((letter, i) => (
                <motion.span
                  key={i}
                  variants={letterVariants}
                  className="inline-block"
                  style={letter === " " ? { width: "0.3em" } : undefined}
                >
                  {letter === " " ? "\u00A0" : letter}
                </motion.span>
              ))}
            </motion.h1>
          )}

          <motion.p
            className="mt-4 max-w-xl text-lg text-foreground-muted"
            initial={prefersReducedMotion ? undefined : { opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5, delay: 0.5 }}
          >
            D1 Golfer. AI Engineer. Building at the intersection.
          </motion.p>

          <motion.p
            className="mt-4 max-w-2xl text-base leading-relaxed text-foreground-muted"
            initial={prefersReducedMotion ? undefined : { opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5, delay: 0.7 }}
          >
            I am a Dartmouth student-athlete, AI researcher, and startup founder
            turning the discipline of competitive golf into engineering that
            matters.
          </motion.p>

          {/* Scroll indicator */}
          {!prefersReducedMotion && (
            <motion.div
              className="mt-16 flex flex-col items-start gap-2"
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              transition={{ delay: 1.2, duration: 0.6 }}
            >
              <motion.span
                className="font-mono text-xs tracking-widest text-foreground-subtle uppercase"
                animate={{ y: [0, 8, 0] }}
                transition={{ duration: 2, repeat: Infinity, ease: "easeInOut" }}
              >
                scroll
              </motion.span>
            </motion.div>
          )}
        </div>
      </ScrollSection>

      {/* ── 2. Terminal ── */}
      <ScrollSection
        id="terminal"
        className="py-24"
        gradientBottom="linear-gradient(to bottom, rgba(16, 185, 129, 0.02), transparent)"
      >
        <div className="[&>div]:shadow-[0_0_60px_rgba(16,185,129,0.04)]">
          <Terminal />
        </div>
      </ScrollSection>

      {/* ── 3. Story Teaser ── */}
      <ScrollSection
        id="story"
        className="py-24"
        parallax
        gradientBottom="linear-gradient(to bottom, transparent, rgba(16, 185, 129, 0.015))"
      >
        <ScrollReveal>
          <h2 className="text-2xl font-semibold text-foreground sm:text-3xl">
            {aboutContent.headline}
          </h2>
        </ScrollReveal>
        <ScrollReveal delay={0.1}>
          <p className="mt-6 max-w-3xl text-base leading-relaxed text-foreground-muted">
            {aboutContent.intro}
          </p>
        </ScrollReveal>
        <ScrollReveal delay={0.2}>
          <p className="mt-4 max-w-3xl text-base leading-relaxed text-foreground-muted">
            {storyExcerpt}
          </p>
        </ScrollReveal>
        <ScrollReveal delay={0.3}>
          <SectionLink href="/about">Read the full story</SectionLink>
        </ScrollReveal>
      </ScrollSection>

      {/* ── 4. Experience Highlights ── */}
      <ScrollSection
        id="experience"
        className="py-24"
        gradientBottom="linear-gradient(to bottom, rgba(16, 185, 129, 0.015), transparent)"
      >
        <ScrollReveal>
          <h2 className="mb-8 text-2xl font-semibold text-foreground sm:text-3xl">
            Experience
          </h2>
        </ScrollReveal>
        <div className="relative">
          {/* Timeline line */}
          <div className="absolute left-[7px] top-0 bottom-0 w-px bg-border" />
          {currentExperiences.map((exp, i) => (
            <ScrollReveal key={`${exp.org}-${exp.role}`} delay={i * 0.1}>
              <TimelineEntry
                role={exp.role}
                org={exp.org}
                dateRange={exp.dateRange}
                description={exp.description}
                bullets={exp.bullets.slice(0, 1)}
                current={exp.current}
              />
            </ScrollReveal>
          ))}
        </div>
        <ScrollReveal delay={0.3}>
          <SectionLink href="/work">View full timeline</SectionLink>
        </ScrollReveal>
      </ScrollSection>

      {/* ── 5. Featured Projects ── */}
      <ScrollSection
        id="projects"
        className="py-24"
        gradientBottom="linear-gradient(to bottom, transparent, rgba(16, 185, 129, 0.025))"
      >
        <ScrollReveal>
          <h2 className="mb-8 text-2xl font-semibold text-foreground sm:text-3xl">
            Featured Work
          </h2>
        </ScrollReveal>
        <div className="grid gap-6 md:grid-cols-2">
          {highlighted.map((project, index) => (
            <ScrollReveal key={project.slug} delay={index * 0.1}>
              <ProjectCardFeatured
                title={project.title}
                description={project.description}
                techStack={project.techStack}
                links={project.links}
                slug={project.slug}
                date={project.date}
              />
            </ScrollReveal>
          ))}
        </div>
        <ScrollReveal delay={0.2}>
          <SectionLink href="/projects">See all projects</SectionLink>
        </ScrollReveal>
      </ScrollSection>

      {/* ── 6. Golf Achievements ── */}
      <ScrollSection
        id="golf"
        className="py-24"
        gradientBottom="linear-gradient(to bottom, rgba(16, 185, 129, 0.025), rgba(16, 185, 129, 0.04))"
      >
        <ScrollReveal>
          <h2 className="mb-2 text-2xl font-semibold text-foreground sm:text-3xl">
            Golf
          </h2>
          <p className="mb-8 max-w-2xl text-base text-foreground-muted">
            {golfTagline}
          </p>
        </ScrollReveal>
        <div className="grid gap-4 grid-cols-2 lg:grid-cols-4">
          {topAchievements.map((achievement, index) => (
            <ScrollReveal key={achievement.title} delay={index * 0.1}>
              <GolfStatCard
                label={achievement.title}
                value={achievement.year}
                description={achievement.description}
                {...(achievement.title === "NCAA D1 Varsity Golf" && {
                  logo: "/dartmouth-big-green.svg",
                  href: "https://dartmouthsports.com/sports/mens-golf/roster/cameron-keith/40950",
                })}
              />
            </ScrollReveal>
          ))}
        </div>
        <ScrollReveal delay={0.4}>
          <SectionLink href="/golf">Full golf career</SectionLink>
        </ScrollReveal>
      </ScrollSection>

      {/* ── 7. Contact CTA ── */}
      <ScrollSection
        id="contact"
        className="py-32"
      >
        <div
          className="absolute inset-0 pointer-events-none"
          style={{
            background:
              "radial-gradient(circle at 50% 50%, rgba(16, 185, 129, 0.05) 0%, transparent 60%)",
          }}
        />
        <ScrollReveal>
          <div className="relative text-center">
            <h2 className="text-2xl font-semibold text-foreground sm:text-3xl">
              Let&apos;s Connect
            </h2>
            <a
              href="mailto:cameron.s.keith.26@dartmouth.edu"
              className="mt-4 block font-mono text-lg text-accent transition-colors hover:text-foreground"
            >
              cameron.s.keith.26@dartmouth.edu
            </a>

            {/* Social links */}
            <div className="mt-8 flex items-center justify-center gap-6">
              {socialLinks.map((link) => (
                <a
                  key={link.label}
                  href={link.href}
                  target={link.icon !== "mail" ? "_blank" : undefined}
                  rel={link.icon !== "mail" ? "noopener noreferrer" : undefined}
                  className="text-foreground-subtle transition-all hover:text-accent hover:scale-110"
                  aria-label={link.label}
                >
                  <SocialIcon icon={link.icon} />
                </a>
              ))}
            </div>

            {/* Resume */}
            <a
              href="/cameron-keith-resume.pdf"
              target="_blank"
              rel="noopener noreferrer"
              className="mt-8 inline-flex items-center gap-2 rounded-lg border border-border px-5 py-2.5 font-mono text-sm text-foreground-muted transition-all hover:border-accent hover:text-accent"
            >
              <svg viewBox="0 0 24 24" className="h-4 w-4 fill-none stroke-current" strokeWidth={1.5}>
                <path strokeLinecap="round" strokeLinejoin="round" d="M3 16.5v2.25A2.25 2.25 0 005.25 21h13.5A2.25 2.25 0 0021 18.75V16.5M16.5 12L12 16.5m0 0L7.5 12m4.5 4.5V3" />
              </svg>
              Resume
            </a>
          </div>
        </ScrollReveal>
      </ScrollSection>
    </>
  );
}

