  1→"use client";
  2→
  3→import { useRef, useEffect, useState, useCallback } from "react";
  4→import { useReducedMotion } from "framer-motion";
  5→import { useRouter } from "next/navigation";
  6→import ReactMarkdown from "react-markdown";
  7→
  8→// ── Types ────────────────────────────────────────────────────────────
  9→
 10→interface TerminalProps {
 11→  className?: string;
 12→}
 13→
 14→interface Message {
 15→  role: "user" | "assistant";
 16→  content: string;
 17→}
 18→
 19→type TerminalLine =
 20→  | { type: "text"; content: string; style?: "command" | "muted" | "success" | "greeting" }
 21→  | { type: "ai"; content: string }
 22→  | { type: "nav"; status: "pending" | "done"; route: string }
 23→  | { type: "loading" };
 24→
 25→// ── Constants ────────────────────────────────────────────────────────
 26→
 27→const STORAGE_KEY = "ck-terminal-messages";
 28→
 29→const BOOT_LINES: { content: string; style?: "command" | "muted" | "success" | "greeting"; delay: number }[] = [
 30→  { content: "$ cam-code init", style: "command", delay: 600 },
 31→  { content: "⠋ Loading context...", style: "muted", delay: 800 },
 32→  { content: "✓ Cameron Keith — D1 Golfer / AI Engineer / Dartmouth '26", style: "success", delay: 500 },
 33→  { content: "✓ Ready", style: "success", delay: 600 },
 34→  { content: "", style: undefined, delay: 300 },
 35→  { content: "Hey! I'm Cam Code — Cameron's AI assistant.", style: "greeting", delay: 400 },
 36→  { content: "Ask me anything or type /help for commands.", style: "greeting", delay: 300 },
 37→];
 38→
 39→const SLASH_COMMANDS: Record<string, { description: string; action: "navigate" | "resume" | "clear" | "help" }> = {
 40→  "/help": { description: "Show available commands", action: "help" },
 41→  "/clear": { description: "Clear conversation", action: "clear" },
 42→  "/home": { description: "Go to home page", action: "navigate" },
 43→  "/about": { description: "Go to about page", action: "navigate" },
 44→  "/work": { description: "Go to work & experience", action: "navigate" },
 45→  "/projects": { description: "Go to projects", action: "navigate" },
 46→  "/golf": { description: "Go to golf page", action: "navigate" },
 47→  "/blog": { description: "Go to blog", action: "navigate" },
 48→  "/contact": { description: "Go to contact page", action: "navigate" },
 49→  "/resume": { description: "Open Cameron's resume", action: "resume" },
 50→};
 51→
 52→const ROUTE_MAP: Record<string, string> = {
 53→  "/home": "/",
 54→  "/about": "/about",
 55→  "/work": "/work",
 56→  "/projects": "/projects",
 57→  "/golf": "/golf",
 58→  "/blog": "/blog",
 59→  "/contact": "/contact",
 60→};
 61→
 62→// ── Helpers ──────────────────────────────────────────────────────────
 63→
 64→function buildHelpLines(): TerminalLine[] {
 65→  const lines: TerminalLine[] = [
 66→    { type: "text", content: "Available commands:", style: "greeting" },
 67→  ];
 68→  for (const [cmd, { description }] of Object.entries(SLASH_COMMANDS)) {
 69→    lines.push({ type: "text", content: `  ${cmd.padEnd(12)} ${description}`, style: "muted" });
 70→  }
 71→  return lines;
 72→}
 73→
 74→function loadMessages(): Message[] | null {
 75→  if (typeof window === "undefined") return null;
 76→  try {
 77→    const stored = localStorage.getItem(STORAGE_KEY);
 78→    if (stored) {
 79→      const parsed = JSON.parse(stored) as Message[];
 80→      if (parsed.length > 0) return parsed;
 81→    }
 82→  } catch {
 83→    // Corrupted storage — reset
 84→  }
 85→  return null;
 86→}
 87→
 88→function persistMessages(messages: Message[]) {
 89→  try {
 90→    localStorage.setItem(STORAGE_KEY, JSON.stringify(messages.slice(-50)));
 91→  } catch {
 92→    // Storage full or unavailable
 93→  }
 94→}
 95→
 96→function messagesToLines(messages: Message[]): TerminalLine[] {
 97→  const lines: TerminalLine[] = [];
 98→  for (const msg of messages) {
 99→    if (msg.role === "user") {
100→      lines.push({ type: "text", content: `❯ ${msg.content}`, style: "command" });
101→    } else {
102→      lines.push({ type: "ai", content: msg.content });
103→    }
104→  }
105→  return lines;
106→}
107→
108→// Keyframes for terminal-blink, terminal-dot-bounce, and cam-code-breathe
109→// are defined in globals.css
110→
111→// ── Markdown Components for AI lines ─────────────────────────────────
112→
113→const markdownComponents = {
114→  p: ({ children }: { children?: React.ReactNode }) => (
115→    <div className="leading-relaxed text-[#e4e4e7] mb-1 last:mb-0">{children}</div>
116→  ),
117→  strong: ({ children }: { children?: React.ReactNode }) => (
118→    <strong className="text-[#fafafa] font-semibold">{children}</strong>
119→  ),
120→  code: ({ children }: { children?: React.ReactNode }) => (
121→    <code className="text-[#10b981] bg-[#1a1a1a] px-1 rounded text-xs font-mono">{children}</code>
122→  ),
123→  ul: ({ children }: { children?: React.ReactNode }) => (
124→    <ul className="list-disc list-inside ml-2 mb-1 last:mb-0 space-y-0.5 text-[#a1a1aa]">{children}</ul>
125→  ),
126→  ol: ({ children }: { children?: React.ReactNode }) => (
127→    <ol className="list-decimal list-inside ml-2 mb-1 last:mb-0 space-y-0.5 text-[#a1a1aa]">{children}</ol>
128→  ),
129→  li: ({ children }: { children?: React.ReactNode }) => (
130→    <li className="text-[#e4e4e7]">{children}</li>
131→  ),
132→  a: ({ href, children }: { href?: string; children?: React.ReactNode }) => (
133→    <a
134→      href={href}
135→      className="text-[#10b981] underline hover:text-[#34d399]"
136→      target="_blank"
137→      rel="noopener noreferrer"
138→    >
139→      {children}
140→    </a>
141→  ),
142→};
143→
144→// ── Line Renderers ───────────────────────────────────────────────────
145→
146→function renderTextLine(line: Extract<TerminalLine, { type: "text" }>) {
147→  const { content, style } = line;
148→
149→  if (!content) return <span className="inline-block h-4">{"\u00A0"}</span>;
150→
151→  switch (style) {
152→    case "command":
153→      if (content.startsWith("❯ ")) {
154→        const cmd = content.slice(2);
155→        const isSlashCommand = cmd.startsWith("/") && cmd.toLowerCase().trim() in SLASH_COMMANDS;
156→        return (
157→          <span className="leading-relaxed">
158→            <span className="text-[#10b981]">❯ </span>
159→            <span className={isSlashCommand ? "text-[#10b981]" : "text-[#fafafa]"}>{cmd}</span>
160→          </span>
161→        );
162→      }
163→      if (content.startsWith("$ ")) {
164→        return (
165→          <span className="leading-relaxed">
166→            <span className="text-[#10b981]">$ </span>
167→            <span className="text-[#fafafa]">{content.slice(2)}</span>
168→          </span>
169→        );
170→      }
171→      return <span className="leading-relaxed text-[#10b981]">{content}</span>;
172→
173→    case "muted":
174→      return <span className="leading-relaxed text-[#71717a]">{content}</span>;
175→
176→    case "success":
177→      if (content.startsWith("✓")) {
178→        return (
179→          <span className="leading-relaxed">
180→            <span className="text-[#10b981]">✓</span>
181→            <span className="text-[#e4e4e7]">{content.slice(1)}</span>
182→          </span>
183→        );
184→      }
185→      return <span className="leading-relaxed text-[#10b981]">{content}</span>;
186→
187→    case "greeting":
188→      return <span className="leading-relaxed text-[#e4e4e7]">{content}</span>;
189→
190→    default:
191→      return <span className="leading-relaxed text-[#a1a1aa]">{content}</span>;
192→  }
193→}
194→
195→function renderAiLine(line: Extract<TerminalLine, { type: "ai" }>) {
196→  if (!line.content) return null;
197→  return (
198→    <div className="leading-relaxed pl-1 border-l-2 border-[#27272a] ml-1 my-1">
199→      <ReactMarkdown components={markdownComponents}>{line.content}</ReactMarkdown>
200→    </div>
201→  );
202→}
203→
204→function renderNavLine(line: Extract<TerminalLine, { type: "nav" }>) {
205→  return (
206→    <div className="flex items-center gap-2 leading-relaxed">
207→      {line.status === "pending" ? (
208→        <svg
209→          className="w-3.5 h-3.5 text-[#10b981] animate-spin shrink-0"
210→          viewBox="0 0 24 24"
211→          fill="none"
212→        >
213→          <circle cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="3" opacity="0.25" />
214→          <path d="M12 2a10 10 0 0 1 10 10" stroke="currentColor" strokeWidth="3" strokeLinecap="round" />
215→        </svg>
216→      ) : (
217→        <span className="text-[#10b981] text-sm">✓</span>
218→      )}
219→      <span className="text-[#a1a1aa] font-mono text-xs">
220→        {line.status === "pending" ? `Navigating to ${line.route}...` : `Navigated to ${line.route}`}
221→      </span>
222→    </div>
223→  );
224→}
225→
226→function renderLoadingLine() {
227→  return (
228→    <div className="flex items-center gap-1 py-1 pl-1">
229→      {[0, 1, 2].map((i) => (
230→        <span
231→          key={i}
232→          className="inline-block w-1.5 h-1.5 rounded-full bg-[#a1a1aa]"
233→          style={{
234→            animation: "terminal-dot-bounce 1.2s ease-in-out infinite",
235→            animationDelay: `${i * 0.15}s`,
236→          }}
237→        />
238→      ))}
239→    </div>
240→  );
241→}
242→
243→const blinkingCursor = (
244→  <span
245→    className="inline-block w-2 h-4 bg-[#10b981] align-middle ml-px"
246→    style={{ animation: "terminal-blink 1s step-end infinite" }}
247→  />
248→);
249→
250→function renderLine(line: TerminalLine, index: number, showCursor?: boolean) {
251→  switch (line.type) {
252→    case "text":
253→      return (
254→        <div key={index}>
255→          {renderTextLine(line)}
256→          {showCursor && blinkingCursor}
257→        </div>
258→      );
259→    case "ai":
260→      return <div key={index}>{renderAiLine(line)}</div>;
261→    case "nav":
262→      return <div key={index}>{renderNavLine(line)}</div>;
263→    case "loading":
264→      return <div key={index}>{renderLoadingLine()}</div>;
265→  }
266→}
