268→// ── Main Component ───────────────────────────────────────────────────
269→
270→export function Terminal({ className }: TerminalProps) {
271→  const containerRef = useRef<HTMLDivElement>(null);
272→  const outputRef = useRef<HTMLDivElement>(null);
273→  const inputRef = useRef<HTMLInputElement>(null);
274→
275→  const [lines, setLines] = useState<TerminalLine[]>([]);
276→  const [messages, setMessages] = useState<Message[]>([]);
277→  const [isTyping, setIsTyping] = useState(false);
278→  const [bootComplete, setBootComplete] = useState(false);
279→  const [inputValue, setInputValue] = useState("");
280→  const [hasStarted, setHasStarted] = useState(false);
281→  const [isLoading, setIsLoading] = useState(false);
282→  const [hasRestoredSession, setHasRestoredSession] = useState(false);
283→  const [isActivated, setIsActivated] = useState(false);
284→
285→  const mountedRef = useRef(true);
286→
287→  const prefersReducedMotion = useReducedMotion();
288→  const router = useRouter();
289→
290→  useEffect(() => {
291→    return () => { mountedRef.current = false; };
292→  }, []);
293→
294→  // ── Scroll to bottom ───────────────────────────────────────────────
295→
296→  const scrollToBottom = useCallback(() => {
297→    if (outputRef.current) {
298→      outputRef.current.scrollTop = outputRef.current.scrollHeight;
299→    }
300→  }, []);
301→
302→  // ── Auto-scroll whenever lines change ──────────────────────────────
303→
304→  useEffect(() => {
305→    scrollToBottom();
306→  }, [lines, scrollToBottom]);
307→
308→  // ── Typewriter utility ─────────────────────────────────────────────
309→
310→  const typeText = useCallback(
311→    (text: string, style?: "command" | "muted" | "success" | "greeting"): Promise<void> => {
312→      return new Promise((resolve) => {
313→        if (!text) {
314→          setLines((prev) => [...prev, { type: "text", content: "", style }]);
315→          resolve();
316→          return;
317→        }
318→
319→        let currentIndex = 0;
320→        // Push an empty text line that we'll fill character by character
321→        setLines((prev) => [...prev, { type: "text", content: "", style }]);
322→
323→        function typeNextChar() {
324→          if (!mountedRef.current) { resolve(); return; }
325→          if (currentIndex < text.length) {
326→            currentIndex++;
327→            setLines((prev) => {
328→              const updated = [...prev];
329→              const last = updated[updated.length - 1];
330→              if (last.type === "text") {
331→                updated[updated.length - 1] = { ...last, content: text.slice(0, currentIndex) };
332→              }
333→              return updated;
334→            });
335→            scrollToBottom();
336→            const delay = 30 + Math.random() * 30;
337→            setTimeout(typeNextChar, delay);
338→          } else {
339→            resolve();
340→          }
341→        }
342→
343→        typeNextChar();
344→      });
345→    },
346→    [scrollToBottom]
347→  );
348→
349→  // ── Boot sequence ──────────────────────────────────────────────────
350→
351→  const playBoot = useCallback(async () => {
352→    if (prefersReducedMotion) {
353→      // Skip animation — show all boot lines instantly
354→      setLines(BOOT_LINES.map((b) => ({ type: "text" as const, content: b.content, style: b.style })));
355→      setBootComplete(true);
356→      return;
357→    }
358→
359→    setIsTyping(true);
360→
361→    for (const bootLine of BOOT_LINES) {
362→      await typeText(bootLine.content, bootLine.style);
363→      await new Promise((r) => setTimeout(r, bootLine.delay));
364→    }
365→
366→    setIsTyping(false);
367→    setBootComplete(true);
368→  }, [prefersReducedMotion, typeText]);
369→
370→  // ── Check for existing session on mount ────────────────────────────
371→
372→  useEffect(() => {
373→    const stored = loadMessages();
374→    if (stored && stored.length > 0) {
375→      setMessages(stored);
376→      setHasRestoredSession(true);
377→      setIsActivated(true);
378→    }
379→  }, []);
380→
381→  // ── Persist messages on every change ───────────────────────────────
382→
383→  useEffect(() => {
384→    if (messages.length > 0) {
385→      persistMessages(messages);
386→    }
387→  }, [messages]);
388→
389→  // ── IntersectionObserver to trigger boot on scroll ─────────────────
390→
391→  useEffect(() => {
392→    if (hasStarted) return;
393→
394→    const container = containerRef.current;
395→    if (!container) return;
396→
397→    const observer = new IntersectionObserver(
398→      (entries) => {
399→        if (entries[0].isIntersecting) {
400→          setHasStarted(true);
401→          observer.disconnect();
402→        }
403→      },
404→      { threshold: 0.3 }
405→    );
406→
407→    observer.observe(container);
408→    return () => observer.disconnect();
409→  }, [hasStarted]);
410→
411→  // ── Start boot or restore session when activated ────────────────────
412→
413→  useEffect(() => {
414→    if (!isActivated) return;
415→
416→    if (hasRestoredSession) {
417→      const restoredLines = messagesToLines(messages);
418→      setLines(restoredLines);
419→      setBootComplete(true);
420→    } else {
421→      playBoot();
422→    }
423→    // eslint-disable-next-line react-hooks/exhaustive-deps
424→  }, [isActivated]);
425→
426→  // ── Auto-focus Phase 1 input when terminal scrolls into view ───────
427→
428→  useEffect(() => {
429→    if (hasStarted && !isActivated) {
430→      setTimeout(() => inputRef.current?.focus(), 100);
431→    }
432→  }, [hasStarted, isActivated]);
433→
434→  // ── Focus input when boot completes ────────────────────────────────
435→
436→  useEffect(() => {
437→    if (bootComplete) {
438→      scrollToBottom();
439→      setTimeout(() => inputRef.current?.focus(), 100);
440→    }
441→  }, [bootComplete, scrollToBottom]);
442→
443→  // ── Slash command handler ──────────────────────────────────────────
444→
445→  const handleSlashCommand = useCallback(
446→    (cmd: string): boolean => {
447→      const normalized = cmd.toLowerCase().trim();
448→      const command = SLASH_COMMANDS[normalized];
449→      if (!command) return false;
450→
451→      // Show the command as a terminal line
452→      setLines((prev) => [...prev, { type: "text", content: `❯ ${normalized}`, style: "command" }]);
453→
454→      // Also track in messages for AI context
455→      const userMsg: Message = { role: "user", content: normalized };
456→
457→      switch (command.action) {
458→        case "help": {
459→          const helpLines = buildHelpLines();
460→          setLines((prev) => [...prev, ...helpLines]);
461→          const helpContent = Object.entries(SLASH_COMMANDS)
462→            .map(([c, { description }]) => `${c} — ${description}`)
463→            .join("\n");
464→          setMessages((prev) => [...prev, userMsg, { role: "assistant", content: helpContent }]);
465→          break;
466→        }
467→
468→        case "clear":
469→          setLines([]);
470→          setMessages([]);
471→          localStorage.removeItem(STORAGE_KEY);
472→          break;
473→
474→        case "navigate": {
475→          const route = ROUTE_MAP[normalized];
476→          if (route) {
477→            setLines((prev) => [...prev, { type: "nav", status: "pending", route }]);
478→            setMessages((prev) => [...prev, userMsg, { role: "assistant", content: `Navigating to ${route}` }]);
479→            router.push(route);
480→            setTimeout(() => {
481→              setLines((prev) => {
482→                const updated = [...prev];
483→                for (let i = updated.length - 1; i >= 0; i--) {
484→                  const line = updated[i];
485→                  if (line.type === "nav" && line.status === "pending" && line.route === route) {
486→                    updated[i] = { ...line, status: "done" };
487→                    break;
488→                  }
489→                }
490→                return updated;
491→              });
492→            }, 700);
493→          }
494→          break;
495→        }
496→
497→        case "resume":
498→          window.open("/cameron-keith-resume.pdf", "_blank");
499→          setLines((prev) => [
500→            ...prev,
501→            { type: "text", content: "Opening Cameron's resume in a new tab.", style: "success" },
502→          ]);
503→          setMessages((prev) => [
504→            ...prev,
505→            userMsg,
506→            { role: "assistant", content: "Opening Cameron's resume in a new tab." },
507→          ]);
508→          break;
509→      }
510→
511→      return true;
512→    },
513→    [router]
514→  );
515→
516→  // ── Send AI message ────────────────────────────────────────────────
517→
518→  const sendMessage = useCallback(
519→    async (text: string) => {
520→      const trimmed = text.trim();
521→      if (!trimmed || isLoading) return;
522→
523→      // Check for slash commands first
524→      if (trimmed.startsWith("/")) {
525→        if (handleSlashCommand(trimmed)) return;
526→        // Unknown slash command
527→        setLines((prev) => [
528→          ...prev,
529→          { type: "text", content: `❯ ${trimmed}`, style: "command" },
530→          { type: "text", content: `Unknown command "${trimmed}". Type /help to see available commands.`, style: "muted" },
531→        ]);
532→        return;
533→      }
534→
535→      // Show user input as command line
536→      setLines((prev) => [...prev, { type: "text", content: `❯ ${trimmed}`, style: "command" }]);
537→
538→      // Build messages for API — use functional updater to avoid stale closure
539→      const userMsg: Message = { role: "user", content: trimmed };
540→      let updatedMessages: Message[] = [];
541→      setMessages((prev) => {
542→        updatedMessages = [...prev, userMsg];
543→        return updatedMessages;
544→      });
545→
546→      // Show loading indicator
547→      setIsLoading(true);
548→      setLines((prev) => [...prev, { type: "loading" }]);
549→
550→      try {
551→        const response = await fetch("/api/agent", {
552→          method: "POST",
553→          headers: { "Content-Type": "application/json" },
554→          body: JSON.stringify({
555→            messages: updatedMessages.slice(-50).map((m) => ({
556→              role: m.role,
557→              content: m.content,
558→            })),
559→          }),
560→        });
561→
562→        if (!response.ok) throw new Error("Request failed");
563→
564→        // Remove loading indicator and add empty AI line for streaming
565→        setLines((prev) => {
566→          const filtered = prev.filter((l) => l.type !== "loading");
567→          return [...filtered, { type: "ai", content: "" }];
568→        });
569→
570→        if (!response.body) throw new Error("No response stream");
571→        const reader = response.body.getReader();
572→        const decoder = new TextDecoder();
573→        let buffer = "";
574→        let accumulatedContent = "";
575→
576→        while (true) {
577→          const { done, value } = await reader.read();
578→          if (done) break;
579→
580→          buffer += decoder.decode(value, { stream: true });
581→          const jsonLines = buffer.split("\n");
582→          buffer = jsonLines.pop() || "";
583→
584→          for (const jsonLine of jsonLines) {
585→            if (!jsonLine.trim()) continue;
586→            try {
587→              const event = JSON.parse(jsonLine);
588→
589→              if (event.type === "text") {
590→                accumulatedContent += event.content;
591→                setLines((prev) => {
592→                  const updated = [...prev];
593→                  // Find the last AI line to update
594→                  for (let i = updated.length - 1; i >= 0; i--) {
595→                    if (updated[i].type === "ai") {
596→                      updated[i] = { type: "ai", content: accumulatedContent };
597→                      break;
598→                    }
599→                  }
600→                  return updated;
601→                });
602→                scrollToBottom();
603→              } else if (event.type === "navigate") {
604→                setLines((prev) => [
605→                  ...prev,
606→                  { type: "nav", status: "pending", route: event.route },
607→                ]);
608→                router.push(event.route);
609→                setTimeout(() => {
610→                  setLines((prev) => {
611→                    const updated = [...prev];
612→                    for (let i = updated.length - 1; i >= 0; i--) {
613→                      const line = updated[i];
614→                      if (line.type === "nav" && line.status === "pending") {
615→                        updated[i] = { ...line, status: "done" };
616→                        break;
617→                      }
618→                    }
619→                    return updated;
620→                  });
621→                }, 700);
622→              } else if (event.type === "open_resume") {
623→                window.open(event.url, "_blank");
624→              } else if (event.type === "error") {
625→                setLines((prev) => {
626→                  const updated = [...prev];
627→                  for (let i = updated.length - 1; i >= 0; i--) {
628→                    if (updated[i].type === "ai" && (updated[i] as Extract<TerminalLine, { type: "ai" }>).content === "") {
629→                      updated[i] = { type: "ai", content: event.message };
630→                      break;
631→                    }
632→                  }
633→                  return updated;
634→                });
635→              }
636→            } catch {
637→              // Skip malformed JSON lines
638→            }
639→          }
640→        }
641→
642→        // Store the assistant response in messages
643→        if (accumulatedContent) {
644→          setMessages((prev) => [...prev, { role: "assistant", content: accumulatedContent }]);
645→        }
646→      } catch {
647→        // Remove loading indicator and show error
648→        setLines((prev) => {
649→          const filtered = prev.filter((l) => l.type !== "loading");
650→          // Check if there's an empty AI line to replace
651→          const lastIdx = filtered.length - 1;
652→          if (lastIdx >= 0 && filtered[lastIdx].type === "ai" && (filtered[lastIdx] as Extract<TerminalLine, { type: "ai" }>).content === "") {
653→            const updated = [...filtered];
654→            updated[lastIdx] = { type: "ai", content: "Sorry, something went wrong. Please try again." };
655→            return updated;
656→          }
657→          return [...filtered, { type: "ai", content: "Sorry, something went wrong. Please try again." }];
658→        });
659→        setMessages((prev) => [
660→          ...prev,
661→          { role: "assistant", content: "Sorry, something went wrong. Please try again." },
662→        ]);
663→      } finally {
664→        setIsLoading(false);
665→      }
666→    },
667→    [isLoading, router, handleSlashCommand, scrollToBottom]
668→  );
669→
670→  // ── Handle submit ──────────────────────────────────────────────────
671→
672→  const handleSubmit = useCallback(() => {
673→    if (!inputValue.trim()) return;
674→    const val = inputValue;
675→    setInputValue("");
676→
677→    if (!isActivated) {
678→      if (val.trim().toLowerCase() === "cam") {
679→        setIsActivated(true);
680→      }
681→      return;
682→    }
683→
684→    sendMessage(val);
685→  }, [inputValue, sendMessage, isActivated]);
686→
687→  // ── Render ─────────────────────────────────────────────────────────
688→
689→  const boxColor = "text-[#3f3f46]";
690→  const boxLine = "─".repeat(120);
691→
692→  // Phase 1: Simple macOS-style terminal
693→  if (!isActivated) {
694→    return (
695→      <div
696→        ref={containerRef}
697→        className={`bg-[#111111] font-mono rounded-lg border border-[#27272a] ${className ?? ""}`}
698→      >
699→        {/* macOS dots + title bar */}
700→        <div className="flex items-center gap-2 px-4 py-3 border-b border-[#27272a]">
701→          <span className="w-3 h-3 rounded-full bg-[#ef4444]" />
702→          <span className="w-3 h-3 rounded-full bg-[#eab308]" />
703→          <span className="w-3 h-3 rounded-full bg-[#22c55e]" />
704→          <span className="text-[#71717a] text-xs ml-2">terminal</span>
705→        </div>
706→
707→        {/* Simple $ prompt */}
708→        <div className="p-4 min-h-[60px]">
709→          <div className="flex items-center">
710→            <span className="text-[#a1a1aa] text-sm">$&nbsp;</span>
711→            <input
712→              ref={inputRef}
713→              type="text"
714→              value={inputValue}
715→              onChange={(e) => setInputValue(e.target.value)}
716→              onKeyDown={(e) => {
717→                if (e.key === "Enter") {
718→                  handleSubmit();
719→                }
720→              }}
721→              className="flex-1 bg-transparent font-mono text-sm text-[#fafafa] outline-none caret-[#a1a1aa]"
722→              spellCheck={false}
723→              autoComplete="off"
724→              placeholder="Type cam to start..."
725→              aria-label="Terminal input"
726→            />
727→          </div>
728→        </div>
729→      </div>
730→    );
731→  }
732→
733→  // Phase 2: Claude Code-style terminal (activated)
734→  return (
735→    <div
736→      ref={containerRef}
737→      className={`bg-[#111111] font-mono ${className ?? ""}`}
738→    >
739→      {/* ╭───╮ top edge */}
740→      <div className={`${boxColor} text-sm flex select-none`}>
741→        <span>╭</span>
742→        <span className="flex-1 overflow-hidden whitespace-nowrap">{boxLine}</span>
743→        <span>╮</span>
744→      </div>
745→
746→      {/* Header with side borders */}
747→      <div className="border-x border-[#3f3f46]">
748→        <div className="px-4 pt-4 pb-3">
749→          <div className="flex items-center gap-5">
750→            {/* CK initials */}
751→            <pre className="text-[#10b981] text-[10px] leading-none m-0" aria-hidden="true">
752→{` ██████╗██╗  ██╗
753→██╔════╝██║ ██╔╝
754→██║     █████╔╝
755→██║     ██╔═██╗
756→╚██████╗██║  ██╗
757→ ╚═════╝╚═╝  ╚═╝`}
758→            </pre>
759→            {/* Labels */}
760→            <div className="flex flex-col justify-center gap-0.5">
761→              <span className="text-[#fafafa] font-semibold text-sm">Cam Code</span>
762→              <span className="text-[#71717a] text-xs">cameronkeithgolf.com</span>
763→            </div>
764→          </div>
765→        </div>
766→      </div>
767→
768→      {/* ├───┤ divider */}
769→      <div className={`${boxColor} text-sm flex select-none`}>
770→        <span>├</span>
771→        <span className="flex-1 overflow-hidden whitespace-nowrap">{boxLine}</span>
772→        <span>┤</span>
773→      </div>
774→
775→      {/* Output with side borders */}
776→      <div className="border-x border-[#3f3f46]">
777→        <div
778→          ref={outputRef}
779→          className="p-4 text-sm min-h-[200px] max-h-[400px] overflow-y-auto"
780→        >
781→          {lines.map((line, i) =>
782→            renderLine(line, i, isTyping && i === lines.length - 1)
783→          )}
784→
785→          {/* Input line with horizontal separators */}
786→          {bootComplete && !isTyping && (
787→            <div className="mt-2">
788→              <div className="text-[#3f3f46] text-sm select-none overflow-hidden whitespace-nowrap">
789→                {boxLine}
790→              </div>
791→              <div className="flex items-center py-1">
792→                <span className="text-[#10b981] text-sm">❯&nbsp;</span>
793→                <input
794→                  ref={inputRef}
795→                  type="text"
796→                  value={inputValue}
797→                  onChange={(e) => setInputValue(e.target.value)}
798→                  onKeyDown={(e) => {
799→                    if (e.key === "Enter") {
800→                      handleSubmit();
801→                    }
802→                  }}
803→                  disabled={isLoading}
804→                  className={`flex-1 bg-transparent font-mono text-sm outline-none caret-[#10b981] disabled:opacity-50 ${
805→                    inputValue.startsWith("/") && inputValue.toLowerCase().trim() in SLASH_COMMANDS
806→                      ? "text-[#10b981]"
807→                      : "text-[#fafafa]"
808→                  }`}
809→                  spellCheck={false}
810→                  autoComplete="off"
811→                  placeholder="Ask anything or /help..."
812→                  aria-label="Terminal input"
813→                />
814→              </div>
815→              <div className="text-[#3f3f46] text-sm select-none overflow-hidden whitespace-nowrap">
816→                {boxLine}
817→              </div>
818→            </div>
819→          )}
820→        </div>
821→      </div>
822→
823→      {/* ╰───╯ bottom edge */}
